import React, { useState, useEffect } from "react";
function App() {
    const [data, setData] = useState();

    useEffect(() => {
        fetch("/fakeData")
            .then((res) => res.json())
            .then((data) => {
                setData(data);
                console.log(data);
            });
    }, []);

    return (
        <div>
            {!data ? (
                <p>...Loading</p>
            ) : (
                data.data.map((d) => {
                    return <p>{d}</p>;
                })
            )}
        </div>
    );
}

export default App;
